(7, 'Ice cream and cake small', 3, 'Asynchronous methods and transitions\r\nAll API methods are asynchronous and start a transition. They return to the caller as soon as the transition is started but before it ends. In addition, a method call on a transitioning component will be ignored.', NULL, '650.00', '2020-03-04 15:53:26', '2020-03-05 12:05:34'),
(8, 'Ice cream and cake big', 3, 'GSM & CDMA FACTORY UNLOCKED! WORKS WORLDWIDE! FACTORY UNLOCKED. iPhone x 64gb. iPhone 8 64gb. iPhone 8 64gb. iPhone X with iOS 11.', NULL, '1200.00', '2020-03-04 16:16:05', '2020-03-05 12:07:33'),
(9, 'ice cake van rose', 3, 'GSM & CDMA FACTORY UNLOCKED! WORKS WORLDWIDE! FACTORY UNLOCKED. iPhone x 64gb. iPhone 8 64gb. iPhone 8 64gb. iPhone X with iOS 11.GSM & CDMA FACTORY UNLOCKED! WORKS WORLDWIDE! FACTORY UNLOCKED. iPhone x 64gb. iPhone 8 64gb. iPhone 8 64gb. iPhone X with iOS 11.', NULL, '1700.00', '2020-03-04 16:16:05', '2020-03-05 11:57:42'),
