(11, 'Search Results Web results  [Violation] phase 2', 3, 'should be optimised for performance. ... Added non-passive event listener to a scroll-blocking \'touchmove\' event. ... Consider marking event handler as \'passive\' to make the page more responsive. ... addEventListener can now take { passive: true } ; see MDN for more info.\r\n\r\n                                          \r\n\r\nshould be optimised for performance. ... Added non-passive event listener to a scroll-blocking \'touchmove\' event. ... Consider marking event handler as \'passive\' to make the page more responsive. ... addEventListener can now take { passive: true } ; see MDN for more info.', NULL, '1500.00', '2020-03-05 09:03:03', '2020-03-05 11:35:33'),
(12, 'Ice cream and cake chops', 7, 'Nov 1, 2017 - I have research and found that there are two option to add export features into datatable. ... i got one more issue with export Button datatable plugin,You can not get full export data ... Initialization Of dataTable on HTML Table.Nov 1, 2017 - I have research and found that there are two option to add export features into datatable. ... i got one more issue with export Button datatable plugin,You can not get full export data ... Initialization Of dataTable on HTML Table.', NULL, '5200.00', '2020-03-05 13:57:12', '2020-03-05 13:57:12'),
(13, 'Web results  [Violation]', 7, 'Are you interested in learning React? If so, I highly recommend you try Wes Bos\' React for Beginners course. Learning from a premium course like that is a serious investment in yourself.\r\n\r\nPlus, this is an affiliate link, so if you purchase the course you help Alligator.io continue to exist at the same time! ', NULL, '500.00', '2020-03-05 13:57:12', '2020-03-05 13:57:12'),
(14, 'Ice cake small', 7, 'repeat, no-repeat, repeat-x and repeat-y are very common and youre probably used to their behavior already. With these keywords, clipping of the image will occur if a copy only partly fits.\r\n\r\nLets give an example of the other 2 possible values, space and round, defined in CSS Backgrounds and Borders Module Level 3 (the CSS3 module for backgrounds and borders). If you can, adjust your browser windows size to better notice the effect.', NULL, '400.00', '2020-03-05 13:57:13', '2020-03-05 13:57:13'),
